              <div class="stl_01" style="top: 0.5991em; left:12.5317em;"><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0408em;">三菱 </span><span class="stl_10 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0408em;">PLC</span><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0408em;">通过以太网连接的远程维护操作 &nbsp;</span></div>
              <div class="stl_01" style="top: 3.3271em; left:7.502em;"><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0212em;">三菱 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0212em;">PLC</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0212em;">设备通过以太网连接，由 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0212em;">SS700</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0212em;">进行远程维护时，具体操作如下： &nbsp;</span></div>
              <div class="stl_01" style="top: 5.264em; left:7.762em;"><span class="stl_15 stl_08 stl_16" style="font-weight:bold;">第一部分：</span><span class="stl_17 stl_08 stl_16" style="font-weight:bold;">PLC</span><span class="stl_15 stl_08 stl_16" style="font-weight:bold;">设备往云管理平台的添加 &nbsp;</span></div>
              <div class="stl_01" style="top: 7.2288em; left:7.482em;z-index:98; "><span class="stl_11 stl_12 stl_18">※第一步：进入管理后台之后点击“设备</span><span class="stl_14 stl_12 stl_18">&gt;</span><span class="stl_11 stl_12 stl_18">以太网”。 &nbsp;</span></div>
              <div class="stl_01" style="top: 18.6288em; left:7.482em;"><span class="stl_11 stl_12 stl_19" style="word-spacing:-0.0031em;">※第二步：输入 </span><span class="stl_14 stl_12 stl_19" style="word-spacing:-0.0031em;">PLC</span><span class="stl_11 stl_12 stl_19" style="word-spacing:-0.0031em;">设备的 </span><span class="stl_14 stl_12 stl_19" style="word-spacing:-0.0031em;">IP</span><span class="stl_11 stl_12 stl_19" style="word-spacing:-0.0031em;">地址，再输入端口号 </span><span class="stl_14 stl_12 stl_19" style="word-spacing:-0.0031em;">5000</span><span class="stl_11 stl_12 stl_19" style="word-spacing:-0.0031em;">，然后点击“添加”按钮、成功显示产品 &nbsp;</span></div>
              <div class="stl_01" style="top: 19.9288em; left:5.732em;"><span class="stl_11 stl_12 stl_20">后再点击“同步到云端”按钮，设备添加成功。 &nbsp;</span></div>
              <div class="stl_01" style="top: 31.3681em; left:7.762em;"><span class="stl_15 stl_08 stl_21" style="font-weight:bold;">第二部分：远程维护的操作 &nbsp;</span></div>
              <div class="stl_01" style="top: 33.3713em; left:7.492em;"><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.009em;">※第一步：通过 </span><span class="stl_14 stl_12 stl_22" style="word-spacing:-0.009em;">IE</span><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.009em;">浏览器访问 </span><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_23 stl_24 stl_22" style="word-spacing:-0.009em;">www.jzt2025.com </span></a><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.009em;">进入极智通 </span></a><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_14 stl_12 stl_22" style="word-spacing:-0.009em;">2025</span></a><a href="http://www.jzt2025.comè¿å¥ææºé2025/" target="_blank"><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.009em;">云管</span></a><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.009em;">理平台，选择远程 </span><span class="stl_14 stl_12 stl_22" style="word-spacing:-0.009em;">PLC</span><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.009em;">连接 &nbsp;</span></div>
              <div class="stl_01" style="top: 34.9113em; left:5.732em;z-index:269; "><span class="stl_11 stl_12 stl_25" style="word-spacing:0.0531em;">的 </span><span class="stl_14 stl_12 stl_25" style="word-spacing:0.0531em;">SS700</span><span class="stl_11 stl_12 stl_25" style="word-spacing:0.0531em;">，点击右边齿轮再点击“开始远程维护”。 &nbsp;</span></div>
              <div class="stl_01" style="top: 47.7129em; left:7.482em;"><span class="stl_11 stl_12 stl_26">※第二步：打开三菱</span><span class="stl_11 stl_12 stl_26" style="word-spacing:0.0394em;">&nbsp;</span><span class="stl_14 stl_12 stl_26" style="word-spacing:0.0394em;">PLC</span><span class="stl_11 stl_12 stl_26" style="word-spacing:0.0394em;">编程软件</span><span class="stl_11 stl_12 stl_26" style="word-spacing:0.0504em;">&nbsp;</span><span class="stl_14 stl_12 stl_26" style="word-spacing:0.0504em;">GX</span><span class="stl_14 stl_12 stl_26" style="word-spacing:-0.0171em;">&nbsp;Developer</span><span class="stl_11 stl_12 stl_26" style="word-spacing:-0.0171em;">，新建工程，新建工程时请选对要远程的</span><span class="stl_11 stl_12 stl_26" style="word-spacing:0.0525em;">&nbsp;</span><span class="stl_14 stl_12 stl_26" style="word-spacing:0.0525em;">PLC</span><span class="stl_14 stl_12 stl_26" style="word-spacing:-0.1996em;">&nbsp;</span><span class="stl_11 stl_12 stl_26" style="word-spacing:0.0525em;">系 &nbsp;</span></div>
              <div class="stl_01" style="top: 49.0129em; left:5.732em;"><span class="stl_11 stl_12 stl_27">列和类型。 &nbsp;</span></div>
            </div>
