              <div class="stl_01" style="top: 0.1371em; left:7.482em;z-index:42; "><span class="stl_11 stl_12 stl_28">※第三步：在上方菜单点击“在线</span><span class="stl_14 stl_12 stl_28">&gt;</span><span class="stl_11 stl_12 stl_28">传输设置</span><span class="stl_11 stl_12 stl_29" style="word-spacing:-0.2504em;">&nbsp;</span><span class="stl_11 stl_12 stl_30">”，</span><span class="stl_11 stl_12 stl_29" style="word-spacing:0.1364em;">&nbsp;</span><span class="stl_11 stl_12 stl_31">将跳出如下对话框，先单击“以太网板块</span><span class="stl_11 stl_12 stl_29" style="word-spacing:-0.2479em;">&nbsp;</span><span class="stl_11 stl_12 stl_30">”， &nbsp;</span></div>
              <div class="stl_01" style="top: 1.4371em; left:5.732em;z-index:53; "><span class="stl_11 stl_12 stl_32">再双击“以太网模块</span><span class="stl_11 stl_12 stl_29" style="word-spacing:-0.2621em;">&nbsp;</span><span class="stl_11 stl_12 stl_33">”，</span><span class="stl_11 stl_12 stl_29" style="word-spacing:0.2386em;">&nbsp;</span><span class="stl_11 stl_12 stl_34">然后输入正确的</span><span class="stl_11 stl_12 stl_34" style="word-spacing:0.1938em;">&nbsp;</span><span class="stl_14 stl_12 stl_34" style="word-spacing:0.1938em;">IP</span><span class="stl_14 stl_12 stl_34" style="word-spacing:-0.0693em;">&nbsp;</span><span class="stl_11 stl_12 stl_34" style="word-spacing:-0.0693em;">地址、站号；最后点击“确认”按钮，关闭该对话 &nbsp;</span></div>
              <div class="stl_01" style="top: 2.7371em; left:5.732em;"><span class="stl_11 stl_12 stl_29">框。 &nbsp;</span></div>
              <div class="stl_01" style="top: 34.9413em; left:7.482em;z-index:112; "><span class="stl_11 stl_12 stl_20">※第四步：关闭之后再点击“其他站（同一网络</span><span class="stl_11 stl_12 stl_29" style="word-spacing:-0.25em;">&nbsp;</span><span class="stl_11 stl_12 stl_35">）”，</span><span class="stl_11 stl_12 stl_29" style="word-spacing:0.2614em;">&nbsp;</span><span class="stl_11 stl_12 stl_20">然后按“确认”按钮。 &nbsp;</span></div>
              <div class="stl_01" style="top: 67.1451em; left:7.482em;z-index:154; "><span class="stl_11 stl_12 stl_36" style="font-weight:bold;">如果判断是否连接成功，在“确认”之前还可以点击“通信测试”</span><span class="stl_14 stl_12 stl_36" style="font-weight:bold;">,</span><span class="stl_11 stl_12 stl_36" style="font-weight:bold;">连接成功将有如下提示： &nbsp;</span></div>
